[
    {
        "query": "SELECT * FROM students;",
        "expected_output": [[1, 'Alice', 20, 'A'], [2, 'Bob', 17, 'B'], [3, 'Charlie', 19, 'C'], [4, 'David', 22, 'A'], [5, 'Eve', 18, 'A']]
    },
    {
        "query": "SELECT name, grade FROM students;",
        "expected_output": [["Alice", "A"], ["Bob", "B"], ["Charlie", "C"], ["David", "A"], ["Eve", "A"]]
    },
    {
        "query": "SELECT id, name, grade FROM students ORDER BY grade;",
        "expected_output": [[1, 'Alice', 'A'], [4, 'David', 'A'], [5, 'Eve', 'A'], [2, 'Bob', 'B'], [3, 'Charlie', 'C']]
    },
    {
        "query": "SELECT * FROM students WHERE grade = 'A';",
        "expected_output": [[1, 'Alice', 20, 'A'], [4, 'David', 22, 'A'], [5, 'Eve', 18, 'A']]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'A';",
        "expected_output": [[3]]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'B';",
        "expected_output": [[2]]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'C';",
        "expected_output": [[1]]
    },
    {
        "query": "SELECT DISTINCT grade FROM students;",
        "expected_output": [["A"], ["B"], ["C"]]
    },
    {
        "query": "SELECT * FROM students WHERE id IN (1, 3, 5);",
        "expected_output": [[1, 'Alice', 20, 'A'], [3, 'Charlie', 19, 'C'], [5, 'Eve', 18, 'A']]
    },
    {
        "query": "SELECT name FROM students WHERE id > 2 ORDER BY grade;",
        "expected_output": [["Charlie"], ["Bob"], ["David"], ["Eve"], ["Alice"]]
    }
]

[
    {
        "query": "SELECT grade, COUNT(*) AS total_students FROM students GROUP BY grade;",
        "expected_output": [["A", 3], ["B", 2], ["C", 1]]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'A';",
        "expected_output": [[3]]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'B';",
        "expected_output": [[2]]
    },
    {
        "query": "SELECT COUNT(*) FROM students WHERE grade = 'C';",
        "expected_output": [[1]]
    },
    {
        "query": "SELECT grade FROM students GROUP BY grade ORDER BY total_students DESC;",
        "expected_output": [["A"], ["B"], ["C"]]
    },
    {
        "query": "SELECT grade, COUNT(*) FROM students WHERE age > 18 GROUP BY grade;",
        "expected_output": [["A", 2], ["B", 1]]
    },
    {
        "query": "SELECT grade, COUNT(*) FROM students WHERE age < 20 GROUP BY grade;",
        "expected_output": [["B", 1], ["A", 2]]
    },
    {
        "query": "SELECT grade, COUNT(*) FROM students WHERE grade NOT IN ('C') GROUP BY grade;",
        "expected_output": [["A", 3], ["B", 2]]
    },
    {
        "query": "SELECT COUNT(DISTINCT grade) FROM students;",
        "expected_output": [[3]]
    },
    {
        "query": "SELECT grade, COUNT(*) FROM students WHERE grade IN ('A', 'B') GROUP BY grade;",
        "expected_output": [["A", 3], ["B", 2]]
    }
]

